This is the value, as at the relevant date, of claims on, or claims to the extent that they are guaranteed by or secured against securities issued by:
- State or Territory Governments in Australia, including State and Territory central borrowing authorities; or
- Overseas central, state and regional governments.

This item also includes all foreign currency claims on the Australian Commonwealth Government.

Also includes claims on central banks (including the Reserve Bank of Australia) other than Australian dollar balances with the Reserve Bank of Australia.

State and Territory central borrowing authorities in Australia include the following corporations established by State and Territory governments to provide finance for government authorities and to manage their surplus funds: 
(a) New South Wales Treasury Corporation (NSW TCorp); 
(b) Treasury Corporation of Victoria (TCV); 
(c) Queensland Treasury Corporation (QTC); 
(d) South Australian Government Financing Authority (SAFA); 
(e) Western Australian Treasury Corporation (WATC); 
(f) Tasmanian Public Finance Corporation (Tas Corp); 
(g) Northern Territory Treasury Corporation (NT TCorp); and 
(h) ACT Treasury.

For long-term ratings the valid enumerated values are:

Grade1 = Standard & Poor's AAA; Moody's Aaa; AM Best Debt aaa; AM Best FSR A++; Fitch AAA;

Grade2 = Standard & Poor's AA+, AA, AA-; Moody's Aa1, Aa2, Aa3; AM Best Debt aa+, aa, aa-; AM Best FSR A+; Fitch AA+, AA, AA-;

Grade3 = Standard & Poor's A+, A, A-; Moody's A1, A2, A3; AM Best Debt a+, a, a-; AM Best FSR A, A-; Fitch A+, A, A-;

Grade4 = Standard & Poor's BBB+, BBB, BBB-; Moody's Baa1, Baa2, Baa3; AM Best Debt bbb+, bbb, bbb-; AM Best FSR B++, B+; Fitch BBB+, BBB, BBB-;

Grade5 = Standard & Poor's BB+, BB, BB- ; Moody's Ba1, Ba2, Ba3; AM Best Debt bb+, bb, bb-; AM Best FSR B, B-; Fitch BB+, BB, BB-;

Grade6 = Standard & Poor's B+, B, B- ; Moody's B1, B2, B3; AM Best Debt b+, b, b-; AM Best FSR C++, C+, C, C-; Fitch B+, B, B-;

Grade7 = Standard & Poor's Below B-; Moody's Below B3; AM Best Debt Below b-; AM Best FSR Below C-; Fitch CCC or Below;

For short-term ratings the valid enumerated values are:

Grade1 = Standard & Poor's A+, AM Best AMB-1+; Fitch F1+;

Grade2 = Standard & Poor's A1; Moody's P1; AM Best AMB-1; Fitch F1;

Grade3 = Standard & Poor's A2; Moody's P2; AM Best AMB-2; Fitch F2;

Grade4 = Standard & Poor's A3; Moody's P3; AM Best AMB-3; Fitch F3;

Grade6 = Standard & Poor's B; Moody's NP Vulnerable; AM Best AMB-4; Fitch B;

Grade7 = Standard & Poor's C; Moody's NP Currently Vulnerable; Fitch C;

This is the value, as at the relevant date, of the following securitisation related items: 

- gain-on-sale, including expected future income from a securitisation exposure that the reporting party reports as an on-balance sheet asset or profit, until irrevocably received; 

- funds provided by the reporting party to establish a spread, reserve or similar account, until the funds are irrevocably paid to the reporting party; 

- the difference between the book value and the amount received by the reporting party, where the originating entity transfers exposures to a special purpose vehicle (SPV) below their book value, unless it is written off in the reporting party's profit and loss (and capital) accounts; and 

- any other specific deductions in accordance with relevant prudential standards. 

This item excludes start-up and other establishment costs that have been capitalised. This item is calculated for capital adequacy purposes and is to be determined in accordance with relevant prudential standards.
